#include<iostream>#include<vector>#include<cmath>using namespace std; int gcd(int a,int b){    while(b){        a%=b;        swap(a,b);    }    return a;}int main(){    ios_base::sync_with_stdio(false);    cin.tie(NULL);    int t;    cin>>t;    while(t--){        int n;        cin>>n;        vector<int> a(n);        for(int i=0;i<n;i++){               cin>>a[i];        }         bool possible=false;        for(int i=0;i<n;i++){            for(int j=i+1;j<n;j++){                if(gcd(a[i],a[j])<=2){                    possible=true;                    break;                }            }            if(possible) break;        }        if(possible){            cout<<"YES\n";        }else{            cout<<"NO\n";        }     }}